import { Column, DataTable, DataTableSelectionChangeParams } from "primereact";
import React, { useState } from "react";
import "./styles.css";
export const ListPerson = () => {
  const [products, setProducts] = useState([
    {
      id: "1000",
      code: "f230fh0g3",
      name: "Bamboo Watch",
      description: "Product Description",
      image: "bamboo-watch.jpg",
      price: 65,
      category: "Accessories",
      quantity: 24,
      inventoryStatus: "INSTOCK",
      rating: 5,
    },
    {
      id: "1001",
      code: "nvklal433",
      name: "Black Watch",
      description: "Product Description",
      image: "black-watch.jpg",
      price: 72,
      category: "Accessories",
      quantity: 61,
      inventoryStatus: "INSTOCK",
      rating: 4,
    },
    {
      id: "1002",
      code: "zz21cz3c1",
      name: "Blue Band",
      description: "Product Description",
      image: "blue-band.jpg",
      price: 79,
      category: "Fitness",
      quantity: 2,
      inventoryStatus: "LOWSTOCK",
      rating: 3,
    },
    {
      id: "1003",
      code: "244wgerg2",
      name: "Blue T-Shirt",
      description: "Product Description",
      image: "blue-t-shirt.jpg",
      price: 29,
      category: "Clothing",
      quantity: 25,
      inventoryStatus: "INSTOCK",
      rating: 5,
    },
  ]);
  const [selectedProducts2, setSelectedProducts2] = useState(null);

  const selectionchange = (e: DataTableSelectionChangeParams) => {
    console.log(e.value);
  };

  return (
    <div className="tamano-list">
      <div className="card">
        <DataTable
          value={products}
          onSelectionChange={(e) => selectionchange(e.value)}
          stripedRows
          dataKey="id"
          selectionMode="single"
          responsiveLayout="scroll"
        >
          <Column field="code" header="Code"></Column>
          <Column field="name" header="Name"></Column>
          <Column field="category" header="Category"></Column>
          <Column field="quantity" header="Quantity"></Column>
        </DataTable>
      </div>
    </div>
  );
};
